int CustomStackTest()
{
    PCC_STACK stack = NULL;
    int cs; 

    StCreate(&stack);

    for (int i = 0; i < 5000; i++)
        StPush(stack, ceva[i]);

    printf("Before:\n");
    StPrint(stack);

    for (int i = 0; i < 5000; i++)
        StPop(stack, &cs);

    printf("After:\n");
    StPrint(stack);

    StDestroy(&stack);
    return 0;
}